INSERT INTO `product` VALUES (1,'2023-05-15 10:20:06.000000','For parents who want to own a children\'s life jacket that is light, warm, compact, easy to wear in all activities and convenient for their children to wear every day, this is the perfect choice. Super baby life jacket Lightweight YODY is made from 100% NYLON. Possesses 3 features in 1: Super light - Super Warm - Super compact. SUPER LIGHTWEIGHT - LIGHTWEIGHT: 1 3S life jacket only has 200gr. SUPER WARM - KEEP WARM: Ability to keep warm Good at a minimum temperature of 9 degrees Celsius, suitable for Vietnamese weather. SUPER COMPACT - PACKABLE: Can be folded and put into the included bag. In addition, the shirt also has the ability to BREAK WIND, DUST and is waterproof. and environmentally friendly.',0,'Children\'s Smart Wind Short Jacket ',40,1,'PRD0001'),(2,'2023-03-12 01:55:34.000000','Product material: 100% Polyester. The kid\'s jacket is made of plastic-coated material to completely optimize wind protection. The shape is comfortable but neat and strong enough. The jacket has a detachable hood, elastic sleeves and a large hem. Optimal functionality when used. Logo printed on the left chest, convenient and sturdy lock',0,'3C Plus Baby Wind',35,1,'PRD0002'),(3,'2022-12-18 14:56:36.000000','3C PLUS children\'s jacket - latest version Fall Winter 2022 collection. Ingredients: 100% Polyester. Made from windproof fabric with basic 2-layer structure. Ability: Windproof - Dustproof - Outstanding water resistance .The shirt\'s shape is comfortable for your baby to move around and can be worn in many situations. The hood is flexible and removable, the sleeves are elastic to fit, and the shirt\'s hem has adjustable elastic bands. The shirt\'s chest is printed with a prominent and sophisticated reflective YODY logo.',0,'3s Plus Children\'s Life Jacket ',29,1,'PRD0003'),(4,'2023-08-19 19:55:12.000000','The product is chosen by parents thanks to its outstanding features. SUPER LIGHTWEIGHT: The shirt is super light, allowing the baby to move comfortably. SUPER WARM (WARM): All layers of fabric and cotton are selected. filtered and designed to keep you warm effectively in cold weather. SUPER COMPACT (PACKABLE): The shirt can be folded in the included bag, extremely convenient. WATER REPELLENT: In light rain conditions, In the morning dew, parents can completely rest assured because the shirt is water-resistant!',0,'Children\'s Life Jacket 3s Plus ',50,1,'PRD0004'),(5,'2023-06-01 15:49:39.000000','Material composition: 100% Nylon. Outer layer and lining are made of Nylon with a unique woven pattern, providing a durable structure for the product. Cotton is made of Polyester. Life jacket Super warm, super light - one product Essential in winter for children. The waistcoat style is easy to combine with many types of outfits, convenient for children to exercise.',0,'Ultralight Gile-shaped Children\'s Life Jacket',48,1,'PRD0005'),(6,'2023-07-28 20:00:44.000000','Warm and safe for your baby with the new 3S Plus Life Jacket at My Jacket. Ingredients: 100% NYLON. The product is chosen by parents thanks to its outstanding features. SUPER LIGHTWEIGHT: In the weight of the jacket Super light, allowing baby to move freely. SUPER WARM (WARM): The layers of fabric and cotton are selected and designed to effectively keep warm in cold weather. SUPER COMPACT (PACKABLE): The shirt can be folded Compact in the included bag, extremely convenient. WATER REPELLENT: In light rain and morning dew conditions, parents can completely rest assured because the shirt has the ability to slide on water!',0,'3C Pro Small Children\'s Jacket',60,1,'PRD0006'),(7,'2023-11-14 05:00:00.000000','The shirt has a sturdy 3-layer structure. Ingredients: 100% NYLON. Good warmth retention, effective wind resistance, waterproof inside. Elegant, youthful colors, suitable for many women\'s skin tones .Form is easy to wear, minimalist but not monotonous. Compact bag design, easy to store other small items. Super light life jacket, good anti-static.',0,'Women\'s 3S Ultralight Raglan Sleeve ',70,2,'PRD0007'),(8,'2023-05-16 22:03:08.000000','Material: 100% Polyester. It\'s a short, super warm, dynamic design without any frills. The large ceiling creates a feeling of elegance and youthfulness, suitable for all situations. With this shirt, you just need to wear a thermal shirt inside and you can go everywhere without fear of cold.',0,'Women\'s Long, Ultra-Light Life Jacket',90,2,'PRD0008'),(9,'2023-09-04 20:39:30.000000','Felt material 100% Polyester. Basic design, easy to wear, easy to coordinate, with warm hat. Super warm fleece sweatshirts are easy to apply to Vietnam\'s weather. Soft and smooth touch feeling. The shirt\'s weight is super light so it\'s convenient to fold and carry. The product is combined with yody products, such as t-shirts, wool, t-shirts, jeans, and sweatpants. Made in Vietnam.',0,'Super Light Women\'s Down Jacket',100,2,'PRD0009'),(10,'2023-04-27 12:52:44.000000','Women\'s life jacket is super light, keeps warm, and flatters the wearer\'s figure. Composition: 100% Polyester.',0,'Tran Tram Women\'s Life Jacket',60,2,'PRD0010'),(11,'2023-07-24 03:21:41.000000','Women\'s windproof, dustproof, warm-keeping jacket. Material: 90% Nylon, 10% Spandex. 4-way stretch fabric, very comfortable and easy to move in. Youthful, modern design, keeps warm Good and suitable for a variety of outfits. Made in Vietnam',0,'Women\'s VIP Float Short Drawstring Hat',55,2,'PRD0011'),(12,'2023-12-17 12:52:44.000000','Product material: 100% NYLON. The shirt is meticulously crafted and thick to help keep the body warm effectively in the cold winter. Modern long-sleeved women\'s life jackets for customers from 25 to 45 years old. The basic long design is simple but not monotonous. The shirt form hugs the body neatly, can be worn every day, suitable for all situations.',0,'Women\'s Smart Waterproof Windbreaker',49,2,'PRD0012'),(13,'2023-03-24 23:46:41.000000','Designed for families. Material: 100% Polyester. Basic 2-layer jacket, press the wrists tightly to keep you warmer when moving to avoid drafts on the body. Detachable hood design, The elastic at the hem can be customized. The pockets have sturdy zippers to store items. The product is combined with thermal shirts, sweaters, elastics, jeans, and khaki pants.',0,'Men\'s Smart Waterproof Windbreaker',99,3,'PRD0013'),(14,'2023-10-17 23:23:23.000000','Ultra-light 3S life jacket for men. Ingredients: Main fabric/ Lining: 100% Nylon. Cotton: 100% Polyester. The jacket is light in weight, providing a light, comfortable wearing experience while still being able to keep warm thanks to the fabric structure and three-layer sandwich cotton. Ultra-light life jacket made from 3S fabric has the ability to The ability to keep warm up to a temperature of 9-10 degrees Celsius. Light, neat, the shirt can be folded and put into the included bag. Soft against the skin. Made in Vietnam.',0,'3C Plus Men\'s Windbreaker Dynamic Waterproof',109,3,'PRD0014'),(15,'2023-07-11 08:17:00.000000','Men\'s windbreaker bomber jacket helps keep the body warm. Ingredients: 90% Nylon, 10% Spandex. Fashionable design and youthful, dynamic colors, easy to coordinate with many different outfits. Bohemian design The neck, sleeves and hem of the shirt create a moderate fit, making it comfortable to wear. The sleeves have zip pockets for strength and convenient, sturdy storage. The seams are meticulous and highly durable when used. use.',0,'Men\'s Bomber Short Shirt Supplement',59,3,'PRD0015'),(16,'2023-12-14 18:27:12.000000','Material: 100% Nylon for the outer layer and lining, 100% Polyester for the cotton layer. Basic design, easy to wear and easy to coordinate. Side pocket with zipper for safe storage of phone or personal belongings. The sleeves and hems are soft and easy to move. The inside is made of special ultra-light cotton material that both keeps the body warm and makes it easy to move. The product is combined with thermal shirts, sweaters, and t-shirts. Also mixed with yody products such as jeans, khaki pants. Made in Vietnam.',0,'Men Jacket Tran Tram',89,3,'PRD0016'),(17,'2023-12-18 21:27:58.000000','Material: 90% Nylon, 10% Spandex. Thick felt fabric suitable for cold weather. 1-layer elastic material makes the product extremely comfortable to use. Big, strong elastic band with prominent logo is the highlight of the product to make it more eye-catching. Made in Vietnam.',0,'Men\'s 3s Plus Down Jacket - Waterproof',79,3,'PRD0017'),(18,'2023-01-18 22:51:44.000000','Ingredients: 87% Polyester + 8% Rayon + 5% Spandex. Soft, comfortable felt fabric. Good absorbency, moisture control. Dry quickly. Elastic stretch keeps form. Felt jacket with hood, the hood has a drawstring to adjust the width of the hat. Pockets on both sides for a short, youthful, dynamic shape. Made in Vietnam.',0,'Men\'s Life Jacket with Ultralight ',69,3,'PRD0018');
